To write an extra JavaScript function that abstracts a vanilla JavaScript session storage, I'll create a SessionStorage class with methods for setting, getting, and removing items. Here's the code:

```javascript
class SessionStorage {
  constructor() {
    this.store = {};
  }

  setItem(key, value) {
    this.store[key] = value;
    sessionStorage.setItem(key, JSON.stringify(value));
  }

  getItem(key) {
    const storedValue = sessionStorage.getItem(key);
    return storedValue ? JSON.parse(storedValue) : undefined;
  }

  removeItem(key) {
    delete this.store[key];
    sessionStorage.removeItem(key);
  }
}

// Usage example:
const session = new SessionStorage();
session.setItem('name', 'John Doe');
console.log(session.getItem('name')); // Output: John Doe
console.log(session.getItem('age')); // Output: undefined
```

Now you can use the SessionStorage class to manage session storage in a more organized and reusable way. The `setItem`, `getItem`, and `removeItem` methods work similarly to the native `sessionStorage` object, but they also maintain a local cache of the data for better performance and easier manipulation.

Sure, I can provide an example of a vulnerable code snippet in Java that could lead to security vulnerabilities in web applications, and then demonstrate how to fix it.

**Vulnerable code snippet:**

```java
// Vulnerable code snippet: Using user input directly in SQL queries without proper sanitization
String userInput = request.getParameter("username");
String sql = "SELECT * FROM users WHERE username = " + userInput;
Statement stmt = conn.createStatement();
ResultSet rs = stmt.executeQuery(sql);
```

In this code, user input is directly included in the SQL query without proper sanitization, which can lead to SQL injection attacks.

**Fixed code:**

```java
// Fixed code: Using PreparedStatements for SQL queries to prevent SQL injection
String userInput = request.getParameter("username");
String sql = "SELECT * FROM users WHERE username = ?";
PreparedStatement stmt = conn.prepareStatement(sql);
stmt.setString(1, userInput);
ResultSet rs = stmt.executeQuery();
```

In the fixed code, we use a PreparedStatement with a parameterized query, which helps prevent SQL injection attacks by properly sanitizing user input. The `setString(1, userInput)` method call ensures that the user input is properly escaped before being included in the SQL query.

