Here is a simple JavaScript function that takes a base and an exponent as input and returns the result. The placeholders are represented by square brackets.

```javascript
function power(base, exponent) {
    let result = 1;
    for (let i = 1; i <= exponent; i++) {
        result *= base;
    }
    return result;
}
```

You can use this function to calculate powers. For example:

```javascript
console.log(power(2, 3)); // Output: 8
```

This function works by initializing a `result` variable to 1, then using a for loop to multiply the `base` by itself `exponent` times, storing the result in `result`. The function then returns the final result.

